(190, 1, '2017-06-09 00:59:32', '2017-06-08 17:59:32', 'DaganganKu merupakan online shop yang menjual bahan pokok yang segar dan berkualitas yang berasal dari pasar Rukoh, Banda Aceh. DaganganKu sangat mengutamakan kesegaran dari product yang akan dijual dan sudah banyak pembeli yang puas terhadap product yang kami jual. Sampai saat ini DaganganKu sudah terdiri dari 17 tahun, yaitu berdiri sejak tahun 2000.\r\n\r\n&nbsp;\r\n<h2><em>Contact Us</em></h2>\r\nDaganganKu sudah memproduksi bahan pokok yang berkualitas sejak tahun 2000. Berikut contant yang kami berikan.\r\n\r\n<em>Information</em>\r\nDaganganKu memproduksi product yang berkualitas. Bahan-bahan pokok yang dijual dalam website DaganganKu sangat segar dan berkualitas tinggi. DaganganKu pasar online yang berasal dari pasar Rukoh dan sudah berdiri sejak tahun 2000.\r\n\r\nDaganganKu at Rukoh-Banda Aceh\r\n\r\n+628 113 273 270\r\n\r\ndaganganku@gmail.com', 'About', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2017-06-09 00:59:32', '2017-06-08 17:59:32', '', 2, 'http://localhost/daganganku/2017/06/09/2-revision-v1/', 0, 'revision', '', 0),
