(217, 1, '2017-06-09 10:30:19', '2017-06-09 03:30:19', 'DaganganKu merupakan online shop yang menjual bahan pokok yang segar dan berkualitas yang berasal dari pasar Rukoh, Banda Aceh. DaganganKu sangat mengutamakan kesegaran dari product yang akan dijual dan sudah banyak pembeli yang puas terhadap product yang kami jual. Sampai saat ini DaganganKu sudah terdiri dari 17 tahun, yaitu berdiri sejak tahun 2000.\r\n\r\n&nbsp;\r\n<h2><em>Contact Us</em></h2>\r\nDaganganKu at Rukoh-Banda Aceh\r\n\r\nNo Rek :\r\n\r\nMandiri : 1243-4647-6465-6748\r\n\r\nBRI          : 2323-2354-7676-5545\r\n\r\nBNI         : 3545-6564-6565-5456\r\n\r\nAtas Nama : Daganganku\r\n\r\n&nbsp;\r\n\r\n+628 113 273 270\r\n\r\ndaganganku@gmail.com', 'About', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2017-06-09 10:30:19', '2017-06-09 03:30:19', '', 2, 'http://localhost/daganganku/2017/06/09/2-revision-v1/', 0, 'revision', '', 0);
